/* eslint-disable jsx-a11y/anchor-is-valid */
// Signin.js
import React from "react";
import "./Signin.css";

import "bootstrap-icons/font/bootstrap-icons.css";
import Navbar1 from "../Navbar";

function Signin() {
  return (
    <div>
      <br />
      <Navbar1 />
      <div className="signin-bg">
        <div className="signin-box">
          <div className="signin-overlay"></div>
          <h1 className="form">Log In</h1>
          <div className="line"></div>
          <br />
          <div className="signin-inputbox">
            <input className="signin-input" type="text" required="required" />
            <span>Username</span>
          </div>
          <br />
          <div className="signin-inputbox">
            <input
              className="signin-input"
              type="password"
              required="required"
            />
            <span>Password</span>
          </div>
          <br />
          <button className="signin-button">Log in</button> <br />
          <div style={{ color: "white", fontSize: "20px" }}>
            Forgot{" "}
            <a style={{ color: "#75006f", textDecoration: "none" }}>Password</a>
            ?
          </div>
          <div style={{ color: "white", fontSize: "20px" }}>
            New to website{" "}
            <a style={{ color: "#75006f", textDecoration: "none" }}>Sign Up</a>{" "}
            Here
          </div>
        </div>
      </div>
    </div>
  );
}

export default Signin;
